            <img style={{width:"100%"}} src="http://localhost:3000/images/header.jpg" alt="img" />
            <div className='card_content'>
                <h1>Write something here</h1>
                <p>Write about your services here whatYou provided to custumer</p>
            </div>
        </div>

        </>
};

export default Services;
